script: |
  super -f text -I q10656.spq | sort > q10656.out

inputs:
  - name: q10656.spq
    data: |
      SELECT - - col2 AS col2 FROM tab0 (FORMAT parquet) cor0 WHERE NOT NULL >= - col2 * - - col0 + - col2 + 64 AND + col2 <> - col1 * - col2 - + 11 + - + 54;
  - name: tab0

outputs:
  - name: q10656.out
    data: |
